// SvcNodeCache caches SvcNode objects in memory in a hash table
// and keeps them in sync with the database.
type SvcNodeCache struct {
	Objs          map[SvcNodeKey]*SvcNodeCacheData
	Mux           util.Mutex
	List          map[SvcNodeKey]struct{}
	FlushAll      bool
	NotifyCbs     []func(ctx context.Context, obj *SvcNode, modRev int64)
	UpdatedCbs    []func(ctx context.Context, old *SvcNode, new *SvcNode)
	DeletedCbs    []func(ctx context.Context, old *SvcNode)
	KeyWatchers   map[SvcNodeKey][]*SvcNodeKeyWatcher
	UpdatedKeyCbs []func(ctx context.Context, key *SvcNodeKey)
	DeletedKeyCbs []func(ctx context.Context, key *SvcNodeKey)
	Store         SvcNodeStore
}

func NewSvcNodeCache() *SvcNodeCache {
	cache := SvcNodeCache{}
	InitSvcNodeCache(&cache)
	return &cache
}

func InitSvcNodeCache(cache *SvcNodeCache) {
	cache.Objs = make(map[SvcNodeKey]*SvcNodeCacheData)
	cache.KeyWatchers = make(map[SvcNodeKey][]*SvcNodeKeyWatcher)
	cache.NotifyCbs = nil
	cache.UpdatedCbs = nil
	cache.DeletedCbs = nil
	cache.UpdatedKeyCbs = nil
	cache.DeletedKeyCbs = nil
}

func (c *SvcNodeCache) GetTypeString() string {
	return "SvcNode"
}

func (c *SvcNodeCache) Get(key *SvcNodeKey, valbuf *SvcNode) bool {
	var modRev int64
	return c.GetWithRev(key, valbuf, &modRev)
}

// STMGet gets from the store if STM is set, otherwise gets from cache
func (c *SvcNodeCache) STMGet(ostm *OptionalSTM, key *SvcNodeKey, valbuf *SvcNode) bool {
	if ostm.stm != nil {
		if c.Store == nil {
			// panic, otherwise if we fallback to cache, we may silently
			// introduce race conditions and intermittent failures due to
			// reading from cache during a transaction.
			panic("SvcNodeCache store not set, cannot read via STM")
		}
		return c.Store.STMGet(ostm.stm, key, valbuf)
	}
	var modRev int64
	return c.GetWithRev(key, valbuf, &modRev)
}

func (c *SvcNodeCache) GetWithRev(key *SvcNodeKey, valbuf *SvcNode, modRev *int64) bool {
	c.Mux.Lock()
	defer c.Mux.Unlock()
	inst, found := c.Objs[*key]
	if found {
		valbuf.DeepCopyIn(inst.Obj)
		*modRev = inst.ModRev
	}
	return found
}

func (c *SvcNodeCache) HasKey(key *SvcNodeKey) bool {
	c.Mux.Lock()
	defer c.Mux.Unlock()
	_, found := c.Objs[*key]
	return found
}

func (c *SvcNodeCache) GetAllKeys(ctx context.Context, cb func(key *SvcNodeKey, modRev int64)) {
	c.Mux.Lock()
	defer c.Mux.Unlock()
	for key, data := range c.Objs {
		cb(&key, data.ModRev)
	}
}

func (c *SvcNodeCache) GetAllLocked(ctx context.Context, cb func(obj *SvcNode, modRev int64)) {
	c.Mux.Lock()
	defer c.Mux.Unlock()
	for _, data := range c.Objs {
		cb(data.Obj, data.ModRev)
	}
}

func (c *SvcNodeCache) Update(ctx context.Context, in *SvcNode, modRev int64) {
	c.UpdateModFunc(ctx, in.GetKey(), modRev, func(old *SvcNode) (*SvcNode, bool) {
		return in, true
	})
}

func (c *SvcNodeCache) UpdateModFunc(ctx context.Context, key *SvcNodeKey, modRev int64, modFunc func(old *SvcNode) (new *SvcNode, changed bool)) {
	c.Mux.Lock()
	var old *SvcNode
	if oldData, found := c.Objs[*key]; found {
		old = oldData.Obj
	}
	new, changed := modFunc(old)
	if !changed {
		c.Mux.Unlock()
		return
	}
	if len(c.UpdatedCbs) > 0 || len(c.NotifyCbs) > 0 {
		newCopy := &SvcNode{}
		newCopy.DeepCopyIn(new)
		for _, cb := range c.UpdatedCbs {
			defer cb(ctx, old, newCopy)
		}
		for _, cb := range c.NotifyCbs {
			if cb != nil {
				defer cb(ctx, newCopy, modRev)
			}
		}
	}
	for _, cb := range c.UpdatedKeyCbs {
		defer cb(ctx, key)
	}
	store := &SvcNode{}
	store.DeepCopyIn(new)
	c.Objs[new.GetKeyVal()] = &SvcNodeCacheData{
		Obj:    store,
		ModRev: modRev,
	}
	log.SpanLog(ctx, log.DebugLevelApi, "cache update", "new", store)
	c.Mux.Unlock()
	c.TriggerKeyWatchers(ctx, new.GetKey())
}

func (c *SvcNodeCache) Delete(ctx context.Context, in *SvcNode, modRev int64) {
	c.DeleteCondFunc(ctx, in, modRev, func(old *SvcNode) bool {
		return true
	})
}

func (c *SvcNodeCache) DeleteCondFunc(ctx context.Context, in *SvcNode, modRev int64, condFunc func(old *SvcNode) bool) {
	c.Mux.Lock()
	var old *SvcNode
	oldData, found := c.Objs[in.GetKeyVal()]
	if found {
		old = oldData.Obj
		if !condFunc(old) {
			c.Mux.Unlock()
			return
		}
	}
	delete(c.Objs, in.GetKeyVal())
	log.SpanLog(ctx, log.DebugLevelApi, "cache delete", "key", in.GetKeyVal())
	c.Mux.Unlock()
	obj := old
	if obj == nil {
		obj = in
	}
	for _, cb := range c.NotifyCbs {
		if cb != nil {
			cb(ctx, obj, modRev)
		}
	}
	if old != nil {
		for _, cb := range c.DeletedCbs {
			cb(ctx, old)
		}
	}
	for _, cb := range c.DeletedKeyCbs {
		cb(ctx, in.GetKey())
	}
	c.TriggerKeyWatchers(ctx, in.GetKey())
}

func (c *SvcNodeCache) Prune(ctx context.Context, validKeys map[SvcNodeKey]struct{}) {
	log.SpanLog(ctx, log.DebugLevelApi, "Prune SvcNode", "numValidKeys", len(validKeys))
	notify := make(map[SvcNodeKey]*SvcNodeCacheData)
	c.Mux.Lock()
	for key, _ := range c.Objs {
		if _, ok := validKeys[key]; !ok {
			if len(c.NotifyCbs) > 0 || len(c.DeletedKeyCbs) > 0 || len(c.DeletedCbs) > 0 {
				notify[key] = c.Objs[key]
			}
			delete(c.Objs, key)
		}
	}
	c.Mux.Unlock()
	for key, old := range notify {
		obj := old.Obj
		if obj == nil {
			obj = &SvcNode{}
			obj.SetKey(&key)
		}
		for _, cb := range c.NotifyCbs {
			if cb != nil {
				cb(ctx, obj, old.ModRev)
			}
		}
		for _, cb := range c.DeletedKeyCbs {
			cb(ctx, &key)
		}
		if old.Obj != nil {
			for _, cb := range c.DeletedCbs {
				cb(ctx, old.Obj)
			}
		}
		c.TriggerKeyWatchers(ctx, &key)
	}
}

func (c *SvcNodeCache) GetCount() int {
	c.Mux.Lock()
	defer c.Mux.Unlock()
	return len(c.Objs)
}

func (c *SvcNodeCache) Flush(ctx context.Context, notifyId int64) {
	log.SpanLog(ctx, log.DebugLevelApi, "CacheFlush SvcNode", "notifyId", notifyId, "FlushAll", c.FlushAll)
	flushed := make(map[SvcNodeKey]*SvcNodeCacheData)
	c.Mux.Lock()
	for key, val := range c.Objs {
		if !c.FlushAll && val.Obj.NotifyId != notifyId {
			continue
		}
		flushed[key] = c.Objs[key]
		log.SpanLog(ctx, log.DebugLevelApi, "CacheFlush SvcNode delete", "key", key)
		delete(c.Objs, key)
	}
	c.Mux.Unlock()
	if len(flushed) > 0 {
		for key, old := range flushed {
			obj := old.Obj
			if obj == nil {
				obj = &SvcNode{}
				obj.SetKey(&key)
			}
			for _, cb := range c.NotifyCbs {
				if cb != nil {
					cb(ctx, obj, old.ModRev)
				}
			}
			for _, cb := range c.DeletedKeyCbs {
				cb(ctx, &key)
			}
			if old.Obj != nil {
				for _, cb := range c.DeletedCbs {
					cb(ctx, old.Obj)
				}
			}
			c.TriggerKeyWatchers(ctx, &key)
		}
	}
}

func (c *SvcNodeCache) Show(filter *SvcNode, cb func(ret *SvcNode) error) error {
	c.Mux.Lock()
	defer c.Mux.Unlock()
	for _, data := range c.Objs {
		if !data.Obj.Matches(filter, MatchFilter()) {
			continue
		}
		err := cb(data.Obj)
		if err != nil {
			return err
		}
	}
	return nil
}

